import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Home.css';
import { Link } from 'react-router-dom';
import { useLocation, useNavigate } from 'react-router-dom';
import HomeContent from './HomeContent';
import RegisCouncelling from './RegisCouncelling';
import Analysis from './Analysis';
import AboutUs from './AboutUs';
import Profile from '../assets/img/profile-user.png';
import Logo from '../assets/img/carecube.png';
import Preloader from './Preloader';
import Slider from './slider'; // Assuming Slider component is located in './Slider'

const Home = () => {
  const [user, setUser] = useState(null);
  const userId = (useLocation().pathname).split('/')[2];
  const [activeButton, setActiveButton] = useState('homecontent');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const user = await axios.post('http://localhost:4000/getUser', {
          userId: userId
        });
        setUser(user.data.detail);
      } catch (err) {
        console.log(err);
      }
    };
    fetchUser();
  }, [userId]);

  useEffect(() => {
    console.log(user);
  }, [user]);

  const handleButtonClick = (buttonName) => {
    setActiveButton(buttonName);
    if (buttonName === 'logout') {
      navigate('/login');
    }
  };

  const slideData = [
    {
      src: 'https://images.unsplash.com/photo-1506765336936-bb05e7e06295?ixlib=rb-0.3.5&s=d40582dbbbb66c7e0812854374194c2e&auto=format&fit=crop&w=1050&q=80',
      title: 'Game',
      copy: 'Explore the world of gaming and entertainment.',
      component: <HomeContent />,
    },
    {
      src: 'https://images.unsplash.com/photo-1496309732348-3627f3f040ee?ixlib=rb-0.3.5&s=4d04f3d5a488db4031d90f5a1fbba42d&auto=format&fit=crop&w=1050&q=80',
      title: 'ChatBot',
      copy: 'Engage in conversations with intelligent chatbots.',
      component: <RegisCouncelling />,
    },
    {
      src: 'https://images.unsplash.com/photo-1504271863819-d279190bf871?ixlib=rb-0.3.5&s=7a2b986d405a04b3f9be2e56b2be40dc&auto=format&fit=crop&w=334&q=80',
      title: 'Yoga',
      copy: 'Practice yoga for physical and mental well-being.',
      component: <Analysis />,
    },
    {
      src: 'https://images.unsplash.com/photo-1478728073286-db190d3d8ce6?ixlib=rb-0.3.5&s=87131a6b538ed72b25d9e0fc4bf8df5b&auto=format&fit=crop&w=1050&q=80',
      title: 'Depression',
      copy: 'Learn about coping mechanisms for dealing with depression.',
      component: <AboutUs />,
    }
  ];

  return (
    <div className="app-container" style={{ marginTop: '10px', width: '100%', height: '100%' }}>
      <div className="app-header" style={{ width: '100%', height: '15vh' }}>
        <div className='app-header-left'>
          <img src={Logo} style={{ width: '140px', height: '100px', marginTop: '15px' }} alt="Logo" />
        </div>
        <div className='app-header-right'>
          <img src={Profile} alt="Profile" style={{ width: '50px' }} />
          <div>{user && user.username}</div>
        </div>
      </div>

      <div className="app-content" style={{ width: '100%', height: '85vh' }}>
        <div className="app-sidebar">
          <button
            className={activeButton === 'homecontent' ? 'active' : ''}
            onClick={() => handleButtonClick('homecontent')}
          >
            Home
          </button>
          <Link to={'therapy'}>
            <button
              className={activeButton === 'therapy' ? 'active' : ''}
              onClick={() => handleButtonClick('therapy')}
            >
              Therapy
            </button>
          </Link>

          <button
            className={activeButton === 'councelling' ? 'active' : ''}
            onClick={() => handleButtonClick('councelling')}
          >
            Counseling
          </button>
          <button
            className={activeButton === 'analysis' ? 'active' : ''}
            onClick={() => handleButtonClick('analysis')}
          >
            Analysis
          </button>
          <button
            className={activeButton === 'aboutus' ? 'active' : ''}
            onClick={() => handleButtonClick('aboutus')}
          >
            About Us
          </button>
        </div>
        <div className="projects-section" style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <div className="projects-section-header">
            <p></p>
            <p className="time"></p>
          </div>

          <Slider slides={slideData} />

          <div className="project-boxes jsGridView" style={{ width: '850px', height: '700px', marginBottom: '60px' }}>
            {slideData.map((slide, index) => (
              <div key={index}>
                {activeButton === 'homecontent' && slide.component}
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
